import React, { useState } from 'react';
import './assets/css/style.css';
import 'bootstrap/dist/css/bootstrap.min.css'
import { useSelector } from 'react-redux';
import MovieOne from './components/MovieOne';
import MovieTwo from './components/MovieTwo';
import MovieThree from './components/MovieThree';

function App() {
  const state = useSelector(state => state)
  const movie_one = state.movie_one.initialState
  const movie_two = state.movie_two.initialState
  const movie_tre = state.movie_three.initialState
  return (
    <div className="container">
      <MovieOne {...movie_one} />
      <MovieTwo {...movie_two} />
      <MovieThree {...movie_tre} />
    </div>
  );
}

export default App;
